import React from "react";
import { Hero } from "../type/type";

interface Props {
  map: string[][];
  heroes: Hero[];
}

export const RenderResults = (props: Props) => {
  const { map, heroes } = props;
  return (
    <>
      <div>
        C - {map[0].length} - {map.length}
      </div>

      {heroes.map((hero) => (
        <div>{`A - ${hero.name} - ${hero.position.x} - ${hero.position.y} - ${hero.orientation} - ${hero.treasure}`}</div>
      ))}
    </>
  );
};
